package nowcoder.最小覆盖子串;

import java.util.HashMap;

/**
 * {@注意事项：两个Integer相比较时，一定要用intVal才能用==，否则用equals，因为当两个数比较大时，两个同值的Integer是不同的对象}
 */
public class Solution {
    public static void main(String[] args) {
//        String str1 = new String("");
//        String str2 = new String("");
//        System.out.println(new Solution().minWindow("", ""));
    }

    public String minWindow(String S, String T) {
        if ("".equals(S) || "".equals(T) || S.length() < T.length()) return "";
        HashMap<Character, Integer> need = new HashMap<>();
        HashMap<Character, Integer> window = new HashMap<>();
        for (int i = 0; i < T.length(); i++) need.put(T.charAt(i), need.getOrDefault(T.charAt(i), 0) + 1);
        int valid = 0, left = 0, right = 0;
        int start = 0, len = Integer.MAX_VALUE;
        while (right < S.length()) {
            char c = S.charAt(right++);
            if (need.containsKey(c)) {
                window.put(c, window.getOrDefault(c, 0) + 1);
                if (need.get(c).intValue() == window.get(c).intValue()) valid++;
            }
//            System.out.println(left + " " + right);
            while (valid == need.size()) {
                if (len > right - left) {
                    start = left;
                    len = right - left;
                }
                char lc = S.charAt(left++);
                if (need.containsKey(lc)) {
                    if (window.get(lc).intValue() == need.get(lc).intValue()) valid--;
                    Integer lci = window.get(lc);
                    if (lci == 1) window.remove(lc);
                    else window.put(lc, lci - 1);
                }
            }
        }
        return len == Integer.MAX_VALUE ? "" : S.substring(start, start + len);
    }
}
